import style from './Landing.module.css';

const Landing = () => {
    return (
        <div className='mainContainer'>
            <div className='start'>
                <h1>Dog Breeds</h1>
                <hr />
                <button>START</button>

            </div>
        </div>
    )
}


export default Landing;
